import React from 'react';
import Frame from './components/Frame';
import {Outlet,Link} from 'react-router-dom';

function App() {
    return (
        <Frame>
            <h1>Bookkeeper</h1>
            <nav
            style={{
                borderBottom: "solid 1px",
                paddingBottom: "1rem"
            }}
            >
            <Link to="/invoices">Invoices</Link> |{" "}
            <Link to="/expenses">Expenses</Link>
            </nav>
            <Outlet />
        </Frame>
    )
}

export default App
